  `group_type` int DEFAULT '1' COMMENT '1普通拼团>>2阶梯拼团',
  `group_num` int DEFAULT NULL COMMENT '成团人数',
  `group_limit_hours` int DEFAULT NULL COMMENT '成团限时',
