-- ----------------------------
-- Table structure for ums_shop
-- ----------------------------
DROP TABLE IF EXISTS `ums_shop`;
CREATE TABLE `ums_shop` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键ID',
